I made some tests and replaced the styles creation in the textfield with the usage of css classes. Here is my test code:

      var start = new Date();
      for (var i = 0; i < 100; i++) {
        var tf = new qx.ui.form.TextField();
        this.getRoot().add(tf, {top: i * 20});
      };
      var end = new Date();
      qx.ui.core.queue.Manager.flush();
      var flushEnd = new Date();

      window.setTimeout(function() {
        alert("Create: " + (end - start) + "ms\nFlush: " + (flushEnd - end) + "ms\nRender: " + (new Date() - flushEnd) + "ms");
      }, 0);
